Assistant Accountant
Job ID: 2100006C
Location: Lagos, Nigeria
Job Function: Admin and Finance Operations
Position type: Permanent
Seniority level: Middle management
Job Type: Full-Time
Description
- We are currently looking for a detail-oriented Assistant Accountant to manage day-to-day office administrative and accounting tasks.
- The person must be a proactive, self-driven individual with good interpersonal, communication, and organisational skills.
- The person will supervise and manage the activities of all finance clerks in the department.
Responsibilities
- Maintain records and process invoices, credit notes, cash sales and receipts receipts (for a busy retail outlet and other sources;
- Follow up with debtor accounts when necessary;
- Post all office petty cash entries of various departments, sales offices etc.
- Post cash into petty cash account and balance to bank and cash on hand;
- Reconciliation of daily sales and petty cash accounts;
- Monitor outstanding and outstanding debts;
- Check all suppliers’ invoices to accounts payables on a daily basis, check goods received noting any discrepancies and ensuring all accounts payable are raised;
- File accounts payable invoices, statements and credit notes as per Filing System;
- Reconciliation of accounts payable on a monthly basis.
Qualifications
- An HND in Accounting or equivalent in Accounting;
- Minimum of 2 years of relevant experience using an accounting software.
Desired Skills:
- Highly meticulous, organized and attentive to detail;
- Team player;
- Strong sense of responsibility;
- Good communication skills;
- Adequate computer skills especially with MS Office (Word, Excel, PowerPoint, Access). Knowledge of accounting software (QuickBooks or Sage) will be an advantage.
